    func test_default() {
        Util｜FileProviderUI.preferredLocalization = nil
        XCTAssertEqual(String.APPLE_ID_OPTION｜FileProviderUI, "\u{55}\u{73}\u{69}\u{6E}\u{67}\u{20}\u{61}\u{6E}\u{20}\u{41}\u{70}\u{70}\u{6C}\u{65}\u{20}\u{49}\u{44}")
        XCTAssertEqual(String.APPLE_ID_PLACEHOLDER｜FileProviderUI, "\u{41}\u{70}\u{70}\u{6C}\u{65}\u{20}\u{49}\u{44}")
        XCTAssertEqual(String.CANCEL_ALERT_OPTION｜FileProviderUI, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.CANCEL_NAV_BAR_BUTTON_TITLE｜FileProviderUI, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.CONNECT｜FileProviderUI, "\u{43}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}")
        XCTAssertEqual(String.CONNECTING｜FileProviderUI, "\u{43}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}\u{69}\u{6E}\u{67}\u{2026}")
        XCTAssertEqual(String.CONNECT_AS｜FileProviderUI, "\u{43}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}\u{20}\u{41}\u{73}\u{3A}")
        XCTAssertEqual(String.CONNECT_TO_SERVER｜FileProviderUI, "\u{43}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{53}\u{65}\u{72}\u{76}\u{65}\u{72}")
        XCTAssertEqual(String.DONE_NAV_BAR_BUTTON_TITLE｜FileProviderUI, "\u{44}\u{6F}\u{6E}\u{65}")
        XCTAssertEqual(String.GUEST_OPTION｜FileProviderUI, "\u{47}\u{75}\u{65}\u{73}\u{74}")
        XCTAssertEqual(String.NAME｜FileProviderUI, "\u{4E}\u{61}\u{6D}\u{65}")
        XCTAssertEqual(String.NEXT_NAV_BAR_BUTTON_TITLE｜FileProviderUI, "\u{4E}\u{65}\u{78}\u{74}")
        XCTAssertEqual(String.OK｜FileProviderUI, "\u{4F}\u{4B}")
        XCTAssertEqual(String.PASSWORD｜FileProviderUI, "\u{50}\u{61}\u{73}\u{73}\u{77}\u{6F}\u{72}\u{64}")
        XCTAssertEqual(String.PASSWORD_OPTIONAL｜FileProviderUI, "\u{4F}\u{70}\u{74}\u{69}\u{6F}\u{6E}\u{61}\u{6C}")
        XCTAssertEqual(String.PASSWORD_REQUIRED｜FileProviderUI, "\u{52}\u{65}\u{71}\u{75}\u{69}\u{72}\u{65}\u{64}")
        XCTAssertEqual(String.RECENT_SERVERS｜FileProviderUI, "\u{52}\u{65}\u{63}\u{65}\u{6E}\u{74}\u{20}\u{53}\u{65}\u{72}\u{76}\u{65}\u{72}\u{73}")
        XCTAssertEqual(String.REGISTERED_USER_OPTION｜FileProviderUI, "\u{52}\u{65}\u{67}\u{69}\u{73}\u{74}\u{65}\u{72}\u{65}\u{64}\u{20}\u{55}\u{73}\u{65}\u{72}")
        XCTAssertEqual(String.REMEMBER_PASSWORD｜FileProviderUI, "\u{52}\u{65}\u{6D}\u{65}\u{6D}\u{62}\u{65}\u{72}\u{20}\u{50}\u{61}\u{73}\u{73}\u{77}\u{6F}\u{72}\u{64}")
        XCTAssertEqual(String.REMOVE｜FileProviderUI, "\u{52}\u{65}\u{6D}\u{6F}\u{76}\u{65}")
        XCTAssertEqual(String.REMOVE_SERVER｜FileProviderUI, "\u{52}\u{65}\u{6D}\u{6F}\u{76}\u{65}\u{20}\u{53}\u{65}\u{72}\u{76}\u{65}\u{72}")
        XCTAssertEqual(String.REMOVE_SERVER_ALERT_MESSAGE｜FileProviderUI, "\u{41}\u{72}\u{65}\u{20}\u{79}\u{6F}\u{75}\u{20}\u{73}\u{75}\u{72}\u{65}\u{20}\u{79}\u{6F}\u{75}\u{20}\u{77}\u{61}\u{6E}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{72}\u{65}\u{6D}\u{6F}\u{76}\u{65}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{73}\u{65}\u{72}\u{76}\u{65}\u{72}\u{3F}")
