        XCTAssertEqual(String.SERVER｜FileProviderUI, "\u{53}\u{65}\u{72}\u{76}\u{65}\u{72}")
        XCTAssertEqual(String.SERVER_ADDRESS_ACCESSIBILITY_LABEL｜FileProviderUI, "\u{53}\u{65}\u{72}\u{76}\u{65}\u{72}\u{20}\u{41}\u{64}\u{64}\u{72}\u{65}\u{73}\u{73}")
